import framer, { motion } from 'framer-motion'

const Introduction = () => {
    return (
        <>
            <div className="introduction">

            </div>
            <motion.div className="introduction-overlay"
                animate={{
                    width: "100vw"
                }}
                exit={{
                    width: "0"
                }}>
            </motion.div>
        </>
    )
}

export default Introduction;
